import React from 'react'

const Knives = ({ knives }) => {
  return (
    <div>
      <center><h1>Knives List</h1></center>
      {knives.map((knife) => (
        <div class="card">
          <div class="card-body">
            <h5 class="card-title">{knife.brand}</h5>
            <h6 class="card-subtitle mb-2 text-muted">{knife.model}</h6>
            <p class="card-text">{knife.price}</p>
          </div>
        </div>
      ))}
    </div>
  )
};

export default Knives
